import React from "react";
import NoPage from "../../components/nopage/ErrorPage";
import Footer from "../../components/footer/Footer";
import Header from "../../components/header/Header";

const ErrorPage = () => {
  return (
    <>
      <div className="NoPage">
        <Header />
        <main>
          <NoPage />
        </main>
        <Footer />
      </div>
    </>
  );
};

export default NoPage;
